B.Gm=new A.cG("We at Penlyght focuses on niche college communities to provide a single point hub to interact, attend events, exchange googs and be an indispensable part of the college community. We are committed to being transparent about the data we collect from you, with whom we share it, and we use your data.\nWe are a social network and online platform for college students. People use our Services to find and be found for business opportunities, share goods with others, and find information. Our Privacy Policy applies to any Member or Visitor to our Services.",null)
B.Bc=new A.dy("Introduction",null)
B.Gv=new A.cG("Our registered users (\u201cMembers\u201d) share their identities, engage with their network, exchange goods, post and view relevant content, and find business and career opportunities. Content and data on some of our Services are viewable to non-members (\u201cVisitors\u201d).\nOUR SERVICES ARE ONLY FOCUSED ON COLLEGE STUDENTS OF INDIA.",null)
B.Bg=new A.dy("SERVICES",null)
B.Gy=new A.cG("Our policies apply to https://penlyght.app and all related to the penlyght -branded apps.",null)
B.B3=new A.dy("Change",null)
B.GC=new A.cG("Penlyght (\u201cwe\u201d or \u201cus\u201d) can modify this Privacy Policy. If we make material changes to it, we will provide notice through our Services, or by other means, to provide you the opportunity to review the changes before they become effective. If you object to any changes, you may request us to close your account.\n\nYou acknowledge that your continued use of our Services after we publish or send a notice about our changes to this Privacy Policy means that the collection, use, and sharing of your personal data is subject to the updated Privacy Policy as of its effective date.",null)
B.B1=new A.dy("DATA WE COLLECT:",null)
B.Gc=new A.cG("1. BASIC:\nRegistration: To create an account you need to provide data including your name, email address, mobile number, branch, degree, password and other basic information.\nMySpace:- Here You Add your schedule of events and its basic information.\nEvents: You can list events you are hosting, you can also view the information of relevant events happening in your ecosystem and register for events.\nMarketplace: You can view/add your old goods information to sell to your peers.\nJob Listing: We post information about jobs/internships available on the internet.\nYou don\u2019t have to post or upload personal data; though if you don\u2019t, it may limit your ability to grow and engage with your network over our Services.",null)
B.Gi=new A.cG("2. SERVICES USE:\nWe log usage data when you visit or otherwise use our Services, including our sites, app and platform technology, such as when you view or click on content,, install or update one of our mobile apps, share events or apply for jobs. We use log-ins, cookies, device information and internet protocol (\u201cIP\u201d) addresses to identify you and log your use.",null)
B.GA=new A.cG("3. CACHING AND SIMILAR TECHNOLOGIES:\nwe use caching and similar technologies (e.g. mixpanel) to collect data (e.g., device IDs) to recognize you and your device(s) on, off and across different services and devices where you have engaged with our Services. ",null)
B.Gz=new A.cG("4. YOUR DEVICE: \nWhen you visit or leave our Services (including some plugins and our cookies or similar technology on the sites of others), we receive the URL of both the site you came from and the one you go to and the time of your visit. We also get information about your network and device (e.g., IP address, proxy server, operating system, web browser and add-ons, device identifier and features, cookie IDs and/or ISP, or your mobile carrier).",null)
B.Gh=new A.cG("5. OTHERS:\nOur Services are dynamic, and we often introduce new features, which may require the collection of new information. If we collect materially different personal data or materially change how we collect, use or share your data, we will notify you and may also modify this Privacy Policy.",null)
B.Bd=new A.dy("HOW WE USE YOUR DATA",null)
B.Gl=new A.cG("How we use your personal data will depend on which Services you use, how you use those Services. We use the data that we have about you to provide and personalize our Services, including with the help of automated systems and inferences we make, so that our Services can be more relevant and useful to you and others.\n1. SERVICES: \n\nWe use your data to authorize access to our Services and honor your settings.",null)
B.Bm=new A.dy("Stay Informed",null)
B.G5=new A.cG("Our Services allow you to stay informed about events regarding peers topics you care about, and from peers you respect. Our Services also allow you to improve your professional skills, or learn new ones. We use the data we have about you (e.g., data you provide, data we collect from your engagement with our Services and inferences we make from the data we have about you), to personalize our Services for you, such as by recommending or ranking relevant content and conversations on our Services. We also use the data we have about you to suggest skills you could add to your profile and skills that you might need to pursue your next opportunity. So, if you let us know that you are interested in a new skill (e.g., by watching a learning video), we will use this information to personalize content in your feed, suggest that you follow certain members on our site, We use your content, activity and other data, including your name and photo, to provide notices to your network and others.",null)
B.B2=new A.dy("Career",null)
B.Go=new A.cG("Our Services allow you to explore careers, evaluate educational opportunities, and seek out career opportunities. ",null)
B.Bk=new A.dy("marketplace",null)
B.GB=new A.cG("1. It is platform to exchange goods among your college community.\n2. COMMUNICATION\nWe will contact you through email, mobile phone, notices posted on our websites or apps, and other ways through our Services, including text messages and push notifications. We will send you messages about the availability of our Services, security, or other service-related issues. We also send messages about how to use our Services, network updates, reminders, job suggestions and promotional messages from us and our partners. Please be aware that you cannot opt out of receiving service messages from us, including security and legal notices.\n3. MARKETING\nOur Services, we use Members\u2019 data and content for invitations and communications promoting membership and network growth, engagement and our Services, such as by showing your connections that you have used a feature on our Services.\n4. DEVELOPING SERVICES AND RESEARCH\nWe use data, including public feedback, to conduct research and development for our Services in order to provide you and others with a better, more intuitive and personalized experience, drive membership growth and engagement on our Services, and help connect professionals to each other and to economic opportunity.\n5. CUSTOMER SUPPORT\nWe use data (which can include your communications) to investigate, respond to and resolve complaints and for Service issues (e.g., bugs).\n6. SECURITY AND INVESTIGATIONS\nWe use your data (including your communications) for security purposes or to prevent or investigate possible fraud or other violations of our User Agreement and/or attempts to harm our Members, Visitors or others.",null)
B.B4=new A.dy("HOW WE SHARE YOUR INFORMATION",null)
B.G8=new A.cG("1. OUR SERVICES:\nYour Information about your registration of events, selling goods, etc. is shared with your peers.\n2. RELATED SERVICES\nWe will share your personal data with our affiliates to provide and develop our Services. We may combine information internally across the different Services covered by this Privacy Policy to help our Services be more relevant and useful to you and others. For example, we may personalize your feed or job recommendations based on your history.\n3. SERVICE PROVIDERS\nWe use others to help us provide our Services (e.g., maintenance, analysis, audit, payments, fraud detection, marketing and development). They will have access to your information as reasonably necessary to perform these tasks on our behalf and are obligated not to disclose or use it for other purposes.\n4. LEGAL DISCLOSURE\nIt is possible that we will need to disclose information about you when required by law, subpoena, or other legal process or if we have a good faith belief that disclosure is reasonably necessary to (1) investigate, prevent or take action regarding suspected or actual illegal activities or to assist government enforcement agencies; (2) enforce our agreements with you; (3) investigate and defend ourselves against any third-party claims or allegations; (4) protect the security or integrity of our Services (such as by sharing with companies facing similar threats); or (5) exercise or protect the rights and safety of Penlyght, our Members, personnel or others. We attempt to notify Members about legal demands for their personal data when appropriate in our judgment, unless prohibited by law or court order or when the request is an emergency. We may dispute such demands when we believe, in our discretion, that the requests are overbroad, vague or lack proper authority, but we do not promise to challenge every demand.\n5. CHANGE IN CONTROL OR SALE\nWe can also share your personal data as part of a sale, merger or change in control, or in preparation for any of these events. Any other entity which buys us or part of our business will have the right to continue to use your data, but only in the manner set out in this Privacy Policy unless you agree otherwise.",null)
B.Bl=new A.dy("YOUR CHOICES AND OBLIGATIONS",null)
B.Gb=new A.cG("1. DATA RETENTION:\nWe generally retain your personal data as long as you keep your account open or as needed to provide you Services. This includes data you or others provided to us and data generated or inferred from your use of our Services.\nRIGHT TO ACCESS AND CONTROL YOUR PERSONAL DATA\n\nFor personal data that we have about you, you can:\nDelete Data: You can ask us to erase or delete all or some of your personal data (e.g., if it is no longer necessary to provide Services to you).\nChange or Correct Data: You can edit some of your personal data through your account. You can also ask us to change, update or fix your data in certain cases, particularly if it\u2019s inaccurate.\nObject to, or Limit or Restrict, Use of Data: You can ask us to stop using all or some of your personal data (e.g., if we have no legal right to keep using it) or to limit our use of it (e.g., if your personal data is inaccurate or unlawfully held).\nRight to Access and/or Take Your Data: You can ask us for a copy of your personal data and can ask for a copy of personal data you provided in machine readable form.\n\nACCOUNT CLOSURE\nYou can request us to close your account at contact@penlyght.app. We will remove your data from our database and save it for different database for time required to comply legal reasons. ",null)
B.B6=new A.dy("OTHER IMPORTANT INFORMATION",null)
B.Gg=new A.cG("1. SECURITY\nWe implement security safeguards designed to protect your data, such as HTTPS. We regularly monitor our systems for possible vulnerabilities and attacks. However, we cannot warrant the security of any information that you send us. There is no guarantee that data may not be accessed, disclosed, altered, or destroyed by breach of any of our physical, technical, or managerial safeguards.\n2. LAWFUL BASES FOR PROCESSING\nWe will only collect and process personal data about you where we have lawful bases. Lawful bases include consent(where you have given consent), contract (where processing is necessary for the performance of a contract with you and \u201clegitimate interests.\u201d\n3. DIRECT MARKETING AND DO NOT TRACK SIGNAL\nWe currently do not share personal data with third parties for their direct marketing purposes without your permission. \n4. CONTACT INFORMATION\nIf you have questions or complaints regarding this Policy, please first contact us at contact@penlyght.app .\n",null)
